import React from "react";
import gLogo from "../../img/hd.png";
import { Link } from "react-router-dom";

const logo = props => (
  <div className='Logo'>
    <img src={gLogo} alt='GUARDIAN' />
    <h4>
      <Link to='/'>
        <i className='fas fa-code' />
        GUARDIAN Command and Control
      </Link>
    </h4>
  </div>
);
export default logo;
